Личный кабинет пациента Первой семейной клиники Петербурга - это удобный и простой в использовании инструмент для записи к специалистам многопрофильных и стоматологических клиник сети в удобное время без звонка в коллцентр. 

Мобильное приложение предназначено для зарегистрированных пациентов и позволяет: 
- осуществлять онлайн запись к врачам;
- видеть историю посещений;
- получать PUSH-уведомления о предстоящем визите; 
- иметь доступ к результатам анализов; 
- быть в курсе акций и специальных предложений; 
- оставлять отзывы о посещении клиники и специалистах;
- заказать обратный звонок из мобильного приложения в один клик;

Медицинский холдинг "Первая семейная клиника Петербурга" - это сеть современных клиник, расположенных в Приморском, Петроградском, Фрунзенском районах в пешей доступности от метро. За более чем 17 лет успешной работы нами была оказана квалифицированная медицинская помощь 450 000 пациентам. На сегодняшний день «Первая семейная клиника Петербурга» включает в себя три многопрофильных медицинских центра, три стоматологические клиники и два отделения врачебной косметологии.
